import React, { Component } from 'react';
import Header from '../header/header';
import './progressbar.css';
import LinearIndicator from './Types/LinearIndicator'

class ProgressBar extends Component {
  constructor(props) {
    super(props)
    this.state = {
        header: [
            { title: 'Progress Indicators' }
        ],
    }
  }
  render() {
    return (
      <div className="wrapper">
          <section className="container">
              <div className="row">
                <Header header={this.state.header[0].title} />   
                <div className="col-md-12 mb-30">
                    <p className="body1 mb-30">Tables include three or more columns and are used to display different sets of information.</p>
                    <LinearIndicator step="step-1" valueNow={'70'.PROGRESSBAR.STEP_1} />
                  </div>
              </div>
        </section>
    </div>
    )
  }
}

export default ProgressBar;
